  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0100064 includes chemical,
  physical, time series and underway - surface data collected from METEOR, POSEIDON,
  TALIARTE and VICTOR HENSEN in the North Atlantic Ocean and South Atlantic Ocean
  from 1995-10-02 to 2009-11-25 and retrieved during cruise ESTOC cruises. These data
  include ALKALINITY - TOTAL, CARBON DIOXIDE - PARTIAL PRESSURE (pCO2), DISSOLVED
  INORGANIC CARBON, SALINITY, SEA SURFACE TEMPERATURE and pH. The instruments used
  to collect these data include Carbon dioxide (CO2) gas analyzer and Carbon dioxide
  (CO2) shower head chamber equilibrator. These data were collected by Melchor Gonzu00c3u00a1lez
  Du00c3u00a1vila of Universidad de Las Palmas de Gran Canaria as part of the ESTOC_Time_Series
  data set.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
